import React from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import Login from './components/login-component';

function App() {
  return (
    <Route path="/login"
        render={(props) => (
          <Login {...props} login={Login} />
        )}
    />
  )
}

export default App;
